import React from 'react';

const Keys = props => {
  return <div style={props.itemType === 'number' ? styles.number : styles.operator}>{props.item}</div>;
};

const styles = {
  number: {
    background: '#D6D6FA'
  },

  operator: {
    background: '#6D6D7F'
  }
};

export default Keys;
